import React from 'react'
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import axios from 'axios'
import { Link, Redirect } from 'react-router-dom';



const Login = ()=>{
   
    const [createInputUser,setcreatInputUser] = React.useState("");
    const [createInputPassword,setcreatInputPassword] = React.useState("");
    
    

    function  logIn(){
        axios
            .post("http://localhost:1000/api/login",{
                User: createInputUser,
                Password: createInputPassword,
            }).then((res)=>{
                console.log("5555")
                console.log(res)
                return <Redirect push to="/logined" />;
            })
    }


   return <div>
        <h1>Login</h1>
            <input value={createInputUser} onChange={(e)=>{
               
                setcreatInputUser(e.target.value);
             } }/>
            <input value={createInputPassword} onChange={(e)=>{
               
               setcreatInputPassword(e.target.value);
             } }/>

             <button onClick={()=>{
                 logIn()
             }}>Login</button>
    </div>;
}
export default Login;
